<script>
	import {
		districts,
		displayedDistricts,
		changeCurrDistrict,
		currDistrict
	} from './../stores/stores';

	let allDistricts, prevDistricts, changeDistrict, presDistrict, svgElem;

	districts.subscribe((value) => {
		allDistricts = value;
	});
	displayedDistricts.subscribe((value) => {
		prevDistricts = value;
	});
	changeCurrDistrict.subscribe((value) => {
		changeDistrict = value;
	});
	currDistrict.subscribe((value) => {
		presDistrict = value;
	});

	const handleMapClick = (e) => {
		if (e.target.localName != 'polygon' || !changeDistrict || prevDistricts.length >= 77) return;

		let targetDistrict = e.target.getAttribute('id').replace("-"," ");

		prevDistricts.push({ district: presDistrict, correct: targetDistrict == presDistrict });
		prevDistricts = [...prevDistricts];
		displayedDistricts.set(prevDistricts);

		getAnotherDistrict();
	};
	const getAnotherDistrict = () => {
		if (prevDistricts.length == 77) return;

		let random = Math.floor(Math.random() * allDistricts.length);
		let randomDistrict = allDistricts[random];
		let sameDistrict = false;

		prevDistricts.forEach((item) => {
			if (item.district == randomDistrict) sameDistrict = true;
		});

		if (sameDistrict) getAnotherDistrict();
		else currDistrict.set(randomDistrict);
	};

    $: {
        if(svgElem){
            allDistricts.forEach(item=>{
                if(item.includes(" ")) svgElem.querySelector("#"+item.replace(" ","-")).style.fill="#fff";
                else svgElem.querySelector("#"+item).style.fill="#fff";
            })
            prevDistricts.forEach(item=>{
                if(!item.correct) return;
                if(item.district.includes(" ")) svgElem.querySelector("#"+item.district.replace(" ","-")).style.fill="crimson";
                else svgElem.querySelector("#"+item.district).style.fill="crimson";
            })
        }
    }
</script>

